import React from "react";
import { BrowserRouter as Router, Switch, route } from "react-router-dom";
import Layout from "../../Component/Layout";
import Home from "../Home";

export default function Main() {
  return (
    <>
      <Router>
        <Layout>
          <Switch>
            <Route>
              <Home />
            </Route>
          </Switch>
        </Layout>
      </Router>
    </>
  );
}
